      return row.name.toLowerCase().includes(searchedVal.toLowerCase());
    });
    setRows(filteredRows);
  };

  const cancelSearch = () => {
    setSearched("");
    requestSearch(searched);
  };

  return (
    <>
    <SearchBar
          value={searched}
          onChange={(searchVal) => requestSearch(searchVal)}
          onCancelSearch={() => cancelSearch()}
    />

    <TableContainer component={Paper} sx={{ maxHeight: 400 }}>
      <Table>
        <TableHead stickyHeader>
          <TableRow class="table-heading">
            <TableCell align="left" sx={{color: "white"}}>School/Department</TableCell>
            <TableCell align="left" sx={{color: "white"}}>Resources Available</TableCell>
          </TableRow>
        </TableHead>

        <TableBody class="table-body" >
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="left">{row.resources}</TableCell>

            </TableRow>
          ))}
        </TableBody>

      </Table>
    </TableContainer>
    </>
  );
}
